import "../App.css";
import { BrowserRouter as Router, Route } from "react-router-dom";
import { Switch } from "react-router-dom";
import LandingPage from "./LandingPage";
import SignUp from "./SignUp";
import Login from "./Login";

function App() {
  return (
    <Switch>
      <Route path="/signup">
        <SignUp />
      </Route>
      <Route path="/login">
        <Login />  
      </Route>

      <Route path="/">
        <LandingPage />
      </Route>
    </Switch>
  );
}

export default App;
